const initState = {
  channels: [
    { id: "1", title: "help me find peach", descrption: "blah blah blah" },
    { id: "2", title: "collect all the stars", descrption: "blah blah blah" },
    { id: "3", title: "egg hunt with yoshi", descrption: "blah blah blah" },
  ],
};

const channelReducer = (state = initState, action) => {
  return state;
};

export default channelReducer;
